import { loremIpsum } from "lorem-ipsum";
import PersonAdd from "./Change_settings";

const BuildPage = (index) => (
  <div>
    <h3>Page {index}</h3>
    <div>
      Page {index} content: {loremIpsum({ count: 50 })}
    </div>
  </div>
);

const Pisko = (message) => {
  return (
    <div>
      <h1>{message} </h1>
      <div>
        <PersonAdd />
      </div>
    </div>
  );
};

const me = () => {
  return (
    <div>
      <div>
        <a href="https://m.vk.com/pimax45">Максим</a>
      </div>
    </div>
  );
};

export const PageOne = () => BuildPage(1);
export const PageTwo = () => BuildPage(2);
export const Pasko = () => Pisko("Плохо");
export const Makson = () => me();
